																			select jd.id_dokter , jd_lg.id_dokter zz, case when jd_lg.id_dokter is null then 0 else jd_lg.id_dokter end id_dokter_logs, jd.id_poli, jd.tanggal,jd.kuota,jd.jml_kunjung 
																			from sm_jadwal_dokter jd left join sm_jadwal_dokter_log jd_lg on jd.id=jd_lg.id_lama where jd.tanggal='2025-02-18'
																			GROUP BY jd.id_dokter, jd_lg.id_dokter,jd.id_poli,jd.tanggal,	jd.kuota,	jd.jml_kunjung) jd_lg
																	GROUP BY id_dokter, id_poli) jd_log On jd_log.id_dokter=jd.id_dokter and jd_log.id_poli=jd.id_poli
											where jd.tanggal='2025-02-18'
											GROUP BY jd.id_dokter, jdl.id_dokter,jd.id_poli,jd.tanggal,	jd.kuota,	jd.jml_kunjung ,jd_log.jml_dr_log) jd
									left join sm_spesialisasi sp on jd.id_poli= sp.id 
									left join (select ab.nama_poli id_poli, id_dokter, count(id) jml from sm_antrian_bpjs ab
														where ab.tanggal_kunjungan='2025-02-18' and status in ('Booking','Check In')
														GROUP BY ab.nama_poli, id_dokter) ab_d 
														ON ab_d.id_poli=jd.id_poli and jd.id_dokter=ab_d.id_dokter
									left join (select ab.nama_poli id_poli, id_dokter, count(id) jml from sm_antrian_bpjs ab
														where ab.tanggal_kunjungan='2025-02-18' and status in ('Booking','Check In')
														GROUP BY ab.nama_poli, id_dokter) ab_dl
														ON ab_dl.id_poli=jd.id_poli and jd.id_dokter_logs=ab_dl.id_dokter		
									left join (select ab.nama_poli id_poli, id_dokter, count(id) jml from sm_antrian_bpjs ab
															where ab.tanggal_kunjungan='2025-02-18' and status in ('Batal')
															GROUP BY ab.nama_poli, id_dokter) ab_bl
															ON ab_bl.id_poli=jd.id_poli and ab_bl.id_dokter=jd.id_dokter													
									left join (select wa.id_unit_layanan id_poli, wa.id_dokter,count(id) jml from sm_pendaftaran_wa wa
															where wa.tgl_kunjungan='2025-02-18'
															GROUP BY wa.id_unit_layanan, wa.id_dokter )wa
															ON wa.id_poli=jd.id_poli and wa.id_dokter=jd.id_dokter
									left join (select lp.id_unit_layanan id_poli, lp.id_dokter, count(lp.id) jml from sm_layanan_pendaftaran lp  
															where to_char(lp.tanggal_layanan, 'YYYY-mm-dd')='2025-02-18' AND lp.konsul=1 and status_terlayani <> 'Batal'
															GROUP BY lp.id_unit_layanan, lp.id_dokter) konsul
															ON konsul.id_poli=jd.id_poli and konsul.id_dokter=jd.id_dokter
									left join (select lp.id_unit_layanan id_poli, lp.id_dokter, count(lp.id) jml from sm_layanan_pendaftaran lp  
															where to_char(lp.tanggal_layanan, 'YYYY-mm-dd')='2025-02-18' and status_terlayani <> 'Batal'
															GROUP BY lp.id_unit_layanan, lp.id_dokter) simrs
															ON simrs.id_poli=jd.id_poli and simrs.id_dokter=jd.id_dokter
									where jd.tanggal='2025-02-18' AND jd.id_dokter <> jd.id_dokter_logs
									order by sp.nama asc
							) semua
					GROUP BY id_dokter,id_poli,tgl
                ) AS subquery
            WHERE sm_jadwal_dokter.id_poli   = subquery.id_poli 
            and   sm_jadwal_dokter.id_dokter = subquery.id_dokter 
            and   sm_jadwal_dokter.tanggal   = subquery.tanggal:: date
